CREATE TABLE T_ACCOUNT (
  ID VARCHAR(32) NOT NULL ,
  MERCHNO VARCHAR(50) ,
  CREATETIME VARCHAR(20) ,
  UPDATETIME VARCHAR(20) ,
  STATUS VARCHAR(2) ,
  ACCOUNTTYPE VARCHAR(2) ,
  BALANCE decimal(16,4) ,
  LASTAMOUNT decimal(16,4) ,
  VERNO decimal(19) ,
  CURRENCY VARCHAR(3) ,
  TOTALAMOUNT decimal(16,4) ,
  CHECKAUTO VARCHAR(64) ,
  FROZENAMOUNT decimal(16,4) 
)




CREATE TABLE T_ACQUIRER (
  ACQUIRNO VARCHAR(4) NOT NULL ,
  ACQUIRNAME VARCHAR(200) ,
  CREATETIME VARCHAR(20) ,
  UPDATETIME VARCHAR(20) 
)





